import React from 'react'
import { Link } from 'react-router-dom'

const Slidebar = () => {
  return (
    <div style={{background:'#000', color:'#fff',height:"100%", width: '30%'}}>

      <Link to="/login"></Link>
      <Link to="/profile"></Link>
      <Link to="/produ"></Link>
    </div>
  )
}

export default Slidebar
